query:
mutatio CreateProfResumeAsCopy($input: CreateAsCopyProfResumeInput!) {
  createProfResumeAsCopy(input: $input) {
    errors {
      ... on ProfResumeDoesNotBelongToSeeker {
        message
        __typename
      }
      __typename
    }
    profResume {
      id
      __typename
    }
    __typename
  }
}
